import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./Home";
import About from "./About";

export default function Routerfile(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home></Home>}/>
                <Route path="/about" element={<About></About>}/>
            </Routes>
        </BrowserRouter>
    )
}
